●インパクトとドライバドリルが合体！クラッチひとつで簡単に切替。<br>
●モーターケースをなくした新開発ビルトインモーター採用で、さらに軽量化、小型化を実現。<br>
●モーターに搭載した強力ネオジ磁石で作業スピード約10％アップ。<br><br>

【付属品】<br>
・磁石付きドライバービットNo.2+65mm<br><br>

【チャック】<br>
・ ワンタッチビットロック方式(段付までの寸法が13mm) <br>
【最大締付トルク】（弾性体締付トルク）<br>
・インパクトモード時：98.0N・m{1,000kgf・cm}<br>
・クラッチモード時：13.7N・m{140kgf・cm}<br><br>

【回転数（無段変速）】<br>
・インパクトモード時：0～2,350回転/分<br>
・クラッチモード時：0～700回転/分<br>

【クラッチ作動トルク】<br>
・クラッチモード時：21段切替<br>
(約0.7～4.4N・m{7～45kgf・cm}まで約0.2N・m{2kgf・cm}きざみ)<br><br>

【本体寸法】<br>
・全長193×全高225×幅（本体駆動部）58mm<br><br>

【質量】1.75kg<br><br>

【能力（目安・フル充電で）】<br>
・ネジ締め：<br>
《インパクトモード》　木ネジ・米松(φ4.2×75mm)約170本<br>
《クラッチモード》　テクスネジ・鉄(φ4×13mm・板厚1.0mm)約520本<br>
ボルト締め：<br>
《インパクトモード》 ボルト(M8×25mm・板厚10mm、普通ボルト)約1,500本<br>
穴あけ：<br>
《クラッチモード》 木工・米松(φ15×20mm)約240穴、鉄・アルミ(φ4.5×2.5mm)約480穴<br>
