●日立商品はすべてに互換性があります！！<br><br>

●クラス最速<br>
高速締付けで作業時間大幅短縮<br>
ねじ締付け時間　約25%高速に!!<br><br>

●カムアウトを軽減<br>
ねじ頭をつぶしにくく作業効率UP!!<br><br>

●日立独自のACS(アクティブコントロールシステム)機能でより高速に効率の良い作業ができます♪<br><br>

ACS機能とは・・・<br><br>
【負荷に応じて回転を自動高速化】ねじ締めスピードを飛躍的にアップさせます。<br>
【打撃タイミングを自動最適化】高速時のカムアウトを軽減します。<br><br>


最短・最小<br>
全長　128mm<br>
作業しやすい手のひらサイズ<br>
狭所作業に威力を発揮!<br><br>


最強の締付けトルク<br>
長ねじもラクラク締付け<br><br>


ビットブレ低減<br>
アンビル部の精度を向上させ、ビットのブレを低減させました。<br><br>


点灯⇔消灯方式が選べるLEDライト付<br>
パネル操作による点灯・消灯の他、スイッチに連動した点灯もできます。<br><br>


用途に合わせて打撃力(締付力)を切替可能<br>
【弱】小径の機械ねじ締付け等(M6程度)<br>
【中】石こうボード貼り等　※下地の硬さによって選択<br>
【強】長ねじ・コーチねじ・ボルト締付け等<br>
【テクスモード】テクスねじの締付け<br><br>

【仕様】<br> 
締付能力 普通ボルト:M5～M16<br>
高力ボルト:M5～M12<br>
小ねじ:4～8<br>
